import React from 'react';
import Blog from '../components/Blog'
import '../stylesheets/blogs.scss'

const BlogList = ({blogs}) => {
  function renderBlogs() {
    return blogs.map((b, i) => {
      return <Blog blog={b} key={i} />
    })
  }

  return (
    <div id="blogs-div">
      <h3>Blogs</h3>
      {renderBlogs()}
    </div>
  )
}

export default BlogList;
